import React from 'react'


class Image extends React.Component {


    render() {
        return (
            <div className="Image">
                        <img src="./img/product-image-2.jpg" alt="Eames Chair DSW" width="100%" height="auto" />
          </div>
        )
    }
}

export default Image;
